def beautifulNumbers(l, r):
    count = 0
    for num in range(l, r + 1):
        digits = list(map(int, str(num)))
        sum_d = sum(digits)
        if sum_d == 0:
            continue
        product = 1
        for d in digits:
            product *= d
        if product % sum_d == 0:
            count += 1
    return count
